import React from 'react';
import './card.scss';

const Card=(props)=>
(
    <div className='cardstyle'>
        <img alt='monster' src={`images/${props.monster.id}.png` }/>

        <h2>
            TITLE: {props.monster.title}
        </h2>
        <b> AUTHOR: {props.monster.authors}</b>
            
        
    </div>
)
export default Card;
